import { makeStyles } from '@material-ui/core/styles';

export default makeStyles({
    tablecreate: {
        backgroundColor: 'rgb(204, 255, 221)',
        borderColor: 'rgb(0, 128, 43)',
        borderStyle: 'solid',
        borderWidth: 5,
        fontFamily: 'serif',
    },
});
